import React, { useState } from "react"
import axios from "axios"

function Login() {
    const {user, setUser} = useState({
        username: "",
        password: ""
    })

    function handleChange(event) {
        console.log(event)
    }

    function handleSubmit(event) {
        event.preventDefault()
    }

    return <div>
        <h1>Login</h1>
        <form onSubmit={handleSubmit}>
            <input onChange={handleChange} type="text" placeholder="Username" value={user.username}/>
            <input onChange={handleChange} type="password" placeholder="Password" value={user.password}/>
            <button type="submit" >Submit</button>
        </form>
    </div>
}

export default Login;
